WITH LastVisit AS (
 SELECT hadm_id
 FROM admissions
 WHERE subject_id = 10020944 AND dischtime IS NOT NULL
 ORDER BY admittime DESC
 LIMIT 1
),
WeightMeasurements AS (
 SELECT valuenum AS weight, charttime
 FROM chartevents
 WHERE subject_id = 10020944 AND itemid = (
 SELECT itemid FROM d_items WHERE label = 'daily weight'
 ) AND hadm_id = (SELECT hadm_id FROM LastVisit)
 ORDER BY charttime
)
SELECT (
 SELECT weight FROM WeightMeasurements LIMIT 1 OFFSET 1
) - (
 SELECT weight FROM WeightMeasurements LIMIT 1
) AS weight_difference;
